import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import './Navigation.css'
import logoHome from "../images/mepelaozen.png"
import whatsapp from "../images/whatsapp.png"
import facebook from "../images/facebook.png"
import instagram from "../images/instagram.png"
import { useDispatch, useSelector } from 'react-redux'
import { logoutUser } from '../store/AuthSlice'
import { toast } from 'react-toastify'


function Navigation() {

  const dispatch = useDispatch()




  const {cartTotalQuantity} = useSelector((state)=>state.cart)
  const auth = useSelector((state)=>state.auth)

  return (

    <nav className='fixed top-0 left-0 bg-red-600 w-full shadow '>

      <div className='container m-auto flex justify-between items-center text-gray-700'>
      <Link to="/home"><img src={logoHome} alt="לוגו למסך הבית" className='w-[200px]'/></Link>

      <ul className=' hidden'>

        <li>
        <Link to="/mac"  className='hover:bg-gray-200 py-4 px-6'>Mac</Link>
        </li>


        <li>
        <Link to="/watch" className='hover:bg-gray-200 py-4 px-6'>Watch</Link>
        </li>



        <li>
        <Link to="/ipad" className='hover:bg-gray-200 py-4 px-6'>Ipad</Link>

        </li>       


        <li>
        <Link to="/iphone" className='hover:bg-gray-200 py-4 px-6'  className='hover:bg-gray-200 py-4 px-6'>Iphone</Link>
        </li>



        <li>
    <Link to="/airpods" className='hover:bg-gray-200 py-4 px-6'>AirPods</Link>
        </li>



        <li>
        <Link to="/samsung"  className='hover:bg-gray-200 py-4 px-6'>Samsung</Link>
        </li>


        <li>
        <Link to="/case" className="dropbtn">אביזרים</Link>
        </li>


        <li>
            <Link to="/cart"><svg xmlns="http://www.w3.org/2000/svg" width="35" height="35" fill="currentColor" className="bi bi-handbag-fill" viewBox="0 0 16 16">
              <path d="M8 1a2 2 0 0 0-2 2v2H5V3a3 3 0 1 1 6 0v2h-1V3a2 2 0 0 0-2-2zM5 5H3.36a1.5 1.5 0 0 0-1.483 1.277L.85 13.13A2.5 2.5 0 0 0 3.322 16h9.355a2.5 2.5 0 0 0 2.473-2.87l-1.028-6.853A1.5 1.5 0 0 0 12.64 5H11v1.5a.5.5 0 0 1-1 0V5H6v1.5a.5.5 0 0 1-1 0V5z"/>
              </svg> 
              <span>{cartTotalQuantity}</span>
              </Link>       
         </li>

      </ul>



      </div>

    </nav>



  )
}

export default Navigation

